import Vue from 'vue'
import Router from 'vue-router'
import HelloWorld from '../views/HomeView.vue'
Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'HelloWorld',
      component: HelloWorld
    }
  ]
})
